import React from "react";

const Nav = () => {
    return (
      <nav class="navbar navbar-dark bg-success">
        <div className="container">
        <div className="row">
          <div className="col-2">
          <a class="navbar-brand" href="#">Click-Game</a>
          </div>
          <div className="col-7">
            Click on an image to begin!
          </div>
          <div className="col-3">
          Score
          </div>
        </div>
        </div>
      </nav>
    );
};

export default Nav;
